import React from "react";
import { useNavigate } from "react-router-dom";

function SignIn() {
    const navigate = useNavigate();

    return (
        <div>
            <h1>Sign In</h1>
            <button onClick={() => navigate("/")}>Back to Home</button>
        </div>
    );
}

export default SignIn;
